func isOverlapped(a string) bool {
    pair := strings.Split(a, ",")
    num1, _ := strconv.Atoi(strings.Split(pair[0], "-")[0])
    num2, _ := strconv.Atoi(strings.Split(pair[0], "-")[1])
    num3, _ := strconv.Atoi(strings.Split(pair[1], "-")[0])
    num4, _ := strconv.Atoi(strings.Split(pair[1], "-")[1])
    
    if (num3 <= num1 && num4 >= num2) || (num1 <= num3 && num2 >= num4) {
        return true
    }
    
    return false
}